import React from "react";
import Card from "./Components/Card";
import SDATA from './SDATA'
let App = () => {
  return (
    <>
     <h1 className="heading_style">List of Top Web Series</h1>
      <Card 
      sname={SDATA[0].sName}
      img={SDATA[0].imgSrc}
      title={SDATA[0].title}
      link={SDATA[0].link}
      />
      <Card 
      sname={SDATA[1].sName}
      img={SDATA[1].imgSrc}
      title={SDATA[1].title}
      link={SDATA[1].link}
      />
      <Card 
      sname={SDATA[2].sName}
      img={SDATA[2].imgSrc}
      title={SDATA[2].title}
      link={SDATA[2].link}
      />
    </>
  );
};

export default App;
